import "./App.css";
import { useState } from "react";
import Axios from "axios";

import "bootstrap/dist/css/bootstrap.min.css";

//import Swal from 'sweetalert2'

function App() {
 
 

  

  const [noticiasList, setNoticias] = useState([]);


  const getNoticias = ()  => {
    Axios.get("http://localhost:3001/noticias").then((response) => {
      setNoticias(response.data);
    });
  }




  
 



  return (

    <div className="container">
            
        <nav class="navbar bg-dark border-bottom border-body navbar-expand-lg " data-bs-theme="dark">
          <div class="container-fluid">
            <a class="navbar-brand" href="#">Navbar</a>
            <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
              <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarSupportedContent">
              <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                <li class="nav-item">
                  <a class="nav-link active" aria-current="page" href="#">Home</a>
                </li>

              </ul>
              <form class="d-flex me-auto, mb-2, mb-lg-0, me-2" role="search">
                <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
                <button class="btn btn-outline-success" type="submit">Search</button>
              </form>
            </div>
          </div>
        </nav>


<div class="row">
  <div class="col">Grid item 1</div>
  <div class="col">Grid item 2</div>

</div>


      

<div class="grid gap-0 row-gap-3">
<div class="p-2 g-col">  
{noticiasList.map((val,key) => {
          return(
            <div className=" row-gap-3">
            {/* <img key={val.id} src={val.imagen} alt=""></img> */}

    
      <div className="card col" style={{width: '18rem'}}>
          <img key={val.id} src={val.imagen} className="card-img-top" alt="..."/>
        <div className="card-body">
          <h5 className="card-title">{val.topic}</h5>
          <p className="card-text">{val.subject}</p>
          <p className="card-text">{val.fecha}</p>
        <a href="#" className="btn btn-dark">Mas informacion</a>
        </div>
      </div>


            </div>
          )})}

</div>
</div>





{/* ----------------tabla---------------- */}


 <button className="btn btn-dark" onClick={getNoticias}>
            Listar
          </button> 


              <table className="table">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">Nombre</th>
                <th scope="col">Edad</th>
                <th scope="col">Pais</th>
                <th scope="col">Puesto</th>


              </tr>
            </thead>
            <tbody>

            {noticiasList.map((val,key) => {
            return (
            <tr key={val.id}>
            <th >{val.id}</th>
            <td>{val.topic}</td>
            <td>{val.imagen}</td>
            <td>{val.fecha}</td>
            <td>{val.subject}</td>
            <td>


            </td>
            </tr>
            )
            })}

            </tbody>

            
        </table>

 



    </div>
  );
}

export default App;
